import React from "react";
import "../../styles/Card.css"


function Card(props) {
  return (
    <div id={props.id} className="card" onClick={props.cardClicked} >
      <div id={props.id} className="img-container" {...props.parent}>
        <img id={props.id} alt={props.name} src={props.image} {...props.parent} />
      </div>
    </div>
  );
}

export default Card;
